import { Carousel } from "../Portal";

const Carousel_Title = ({ title, thing }) => {
  return (
    <section className="container padding text-center">
      {title && (
        <h3 className="title mb-10 mac-bg">
          دانش آموختگان ما در این شرکت ها مشغول به کارند
        </h3>
      )}
      <div className="px-5">
        <Carousel type="company" things={thing} />
      </div>
    </section>
  );
};

export default Carousel_Title;
